column2:
@AndyTheNguyen @BoredApeYC I think time will tell for all of us.

Spending thousands, tens of thousands, hundreds of thousands of dollars on NFTs could mean either that were incredibly smart, or incredibly stupid.

That outcome hasn't been determined yet.

@DiscoverXnft One just sold for 1.something WETH.

Dude probably looked at his mails, couldn't believe it and slapped accept.

Now he can't believe he got rekt on his Kevin.

@metazord_eth @PJETCH @mrmakerbot This week will be a testing time of price discovery for IF. Listings are currently outnumbering sales by around 50:1. 

They'll need to hold firm collectively to maintain the floor and be able to sustain without day 1 hype and volume.

Breaking ranks could start a downtrend.

@Gee__Gazza Seems like at the light-speed we operate, Karafuru is 'very January 2022'.

It is no longer - it seems - 'the best community by far' &amp; 'my new favourite PFP'.

Perhaps that's what happens with the masses in the unforgiving NFT market right now. It's not a 'bluechip', so move on.

Flur is a professional trader who lives &amp; dies based upon the trades he executes. I presume he read's the room well on what will perform long-term.

Flur has a few viable options;

1. HODL untill the floor price surpasses his purchase cost average.

@QDub_7 A thoughtful post.

Undoubtedly some overestimate their NFT prowess due to getting exceptionally lucky in the very recent past.

Given the fickle nature of this space, there is probably a parallel universe where #BAYC is an obscure, valueless, forgotten NFT in a bunch of wallets.

@PuffYatty My honest opinion, I like them a lot. I think they're novel and fun. Future will strongly depend on what the team do in the next 3, 6, 12 months.

However, I don't think they're great as a PFP (yet), they're still deep in price discovery.

I would (and will) buy at 3ETH.

@0xwinky @InvsbleFriends @doodles Agreed. I've seen a few peeps today questioning if the whole project is animated - I thought that was a given.

It'll be an absolute bloodbath if they're not.

Will you go back and look at what your IF pulled? I can't help myself. ðŸ˜‚
